export const Footer = () => {
    return (
      <footer>
        <Navbar expand="sm" bg="dark" variant="dark">
        <Container>
          <Navbar.Brand>Â© 2021 Juliana F. Borges </Navbar.Brand>
        </Container>
        </Navbar>

        <Navbar expand="sm" bg="dark" variant="dark">
          <Container>
          <Nav.Link href="mailto:fborges.j@gmail.com">
